import React from "react";
import {
  Card,
  CardHeader,
  CardContent,
  Typography,
  CardMedia,
  Table,
  TableHead,
  TableRow,
  TableBody
} from "@material-ui/core";
import MuiTableCell from "@material-ui/core/TableCell";
import { makeStyles, withStyles } from "@material-ui/core/styles";

const useStyles = makeStyles(theme => ({
  root: {
    maxWidth: 500,
    height: 150,
    margin: "10px auto",
    display: "flex"
  },
  left: {
    display: "flex",
    flexDirection: "column"
  },
  right: {
    display: "flex",
    justifyContent: "space-around",
    margin: "0 auto"
  },
  media: {
    height: 90,
    width: 150
  }
}));
const TableCell = withStyles({
  root: {
    borderBottom: "none"
  }
})(MuiTableCell);
const ReportItem = () => {
  const classes = useStyles();
  return (
    <Card className={classes.root}>
      <div className={classes.left}>
        <CardMedia
          className={classes.media}
          image="https://assets.hackbotone.com/images/flags/flag_brazil.png"
        />
        <CardHeader title="Brazil" />
      </div>
      <div>
        {/* <CardContent className={classes.right}>
          <Typography>Confirmed</Typography>
          <Typography>Deaths</Typography>
          <Typography>Recovered</Typography>
          <Typography>Active</Typography>
        </CardContent>
        <CardContent className={classes.right}>
          <Typography>1000000</Typography>
          <Typography>2000000</Typography>
          <Typography>3000000</Typography>
          <Typography>5000000</Typography>
        </CardContent> */}
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Confirmed</TableCell>
              <TableCell>Deaths</TableCell>
              <TableCell>Recovered</TableCell>
              <TableCell>Active</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            <TableCell>1000000</TableCell>
            <TableCell>5000</TableCell>
            <TableCell>345555</TableCell>
            <TableCell>223444</TableCell>
          </TableBody>
        </Table>
      </div>
    </Card>
  );
};

export default ReportItem;
